import { BrowserRouter, Routes, Route } from 'react-router-dom';
import AddTask from './components/tasks';

const AppRoutes = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/tasks/add" element={<AddTask />} />
      </Routes>
    </BrowserRouter>
  );
};

export default AppRoutes;
